import Schedule from './Schedule';
import './Home.css';
import Memories from '../Memories/Memories';

function Home() {
    return (
        <div className='home'>
            <div className='content'>
                <video width="320" height="240" autoPlay>
                    <source src="video.mp4" type="video/mp4" />
                    Autplay not supported
                </video>
            </div>
            <Memories />
            <div className='schedule' style={{ marginTop: '30px' }}>
                <Schedule />
            </div>
        </div>
    )
}
export default Home
